import React from 'react';

function ForecastWeather({ resultData }) {
  console.log(resultData)
  return (
    <div className="componentsBoxLayout">
      <div>{resultData.list.splice(0, 5).map((item, index) => (
        <div key={index}>
          <div>
            <img alt="Weather Icon" src={`icons/${item.weather[0].icon}.png`} />
          </div>
        </div>
      ))}</div>
    </div>
  )
}

export default ForecastWeather;
